	'Intervenção direta dos profissionais da Terra dos Homens nas famílias e comunidades de crianças e adolescentes com direitos violados no Rio de Janeiro, por meio de acompanhamento psicológico, social e econômico.', 
	'Representante', 
	'A Terra dos Homens atua para o fortalecimento da estrutura jurídica e política da área da infância. Isto se dá por meio da articulação de políticas públicas e de redes e da participação ativa em fóruns e conselhos de direitos da infância e juventude, assim como de consultorias na elaboração de normativas e diretrizes para promoção e defesa dos direitos de crianças e adolescentes. Há dez anos a Terra dos Homens representa a sociedade civil em espaços de controle social: Conselho Municipal dos Direitos da Criança e do Adolescente (CMDCA-Rio), Conselho Estadual dos Direitos da Criança e do Adolescente (CEDCA) e Fórum dos Direitos da Criança e do Adolescente.', 
